import React, { Component } from 'react';
import { Link } from "react-router-dom";

class PlaylistItem extends Component {
    render() {
        return (
            <Link to={"/videoplayer/" + this.props.playlistID + "." + this.props.videoID}>
                <div className="row" style={{ backgroundColor: "white", border: "1px", margin: "1px 0px"}}>
                    <div className="col-3">
                        <img src={this.props.videoThumbnail} style={{ height: "50px", backgroundColor: "white" }} alt=""></img>
                    </div>
                    <div className="col-9" style={{color:"black"}}>{this.props.videoTitle}</div>
                </div>
            </Link>
        );
    }
}

export default PlaylistItem;
